export const users = [
    {
        username: "Levi",
        useremail: "123@123.com",
        userpassword: "1234",
    },
    {
        username: "Jiao",
        useremail: "dot@gmail.com",
        userpassword: "dot",
    }
]

export function insertUser(user){
    users.push(user);
}
